import React, { Component } from 'react';

const conteudos = [
    {
      conteudo: 'High Order Functions',
      bloco: 8,
      status: 'Aprendido'
    },
    {
      conteudo: 'Composicao de Componentes',
      bloco: 11,
      status: 'Aprendendo',
    },
    {
      conteudo: 'Composicao de Estados',
      bloco: 12,
      status: 'Aprenderei'
    },
    {
      conteudo: 'Redux',
      bloco: 16,
      status: 'Aprenderei'
    },
  ];

class Content extends Component {
    render(){
        return <div>{conteudos.map((element) => {
            return (
                `O conteudo é: ${element.conteudo} \n
                Status: ${element.status} \n
                Bloco: ${element.bloco} \n
                `
            )
        })}</div>
    }
}

export default Content
